import React from "react"

import Card from "./UI/Card"
import "./Auth.css"

const Auth = (props) => {
	const loginHandler = () => {}

	return (
		<div className="auth">
			<Card>
				<h2>You are not authenticated!</h2>
				<p>Please log in to continue.</p>
				<button onClick={loginHandler}>Log In</button>
			</Card>
		</div>
	)
}

export default Auth
